import { useState } from 'react';

function Survey() {
  const [name, setName] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    alert
  }

  return (
    <form onSubmit={handleSubmit}>
      <label>
        What is your full name?
        <input 
          type="text"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </label>
      <input type="submit" />
    </form>
  )
}

export default Survey;

